        pub const unsafe fn from_u8_unchecked(id: u8) -> Self {
            unsafe { core::mem::transmute(id) }
        }
        pub const fn from_u8(id: u8) -> Option<Self> {
            if id < Self::VARIANTS as u8 {
                Some(unsafe { Self::from_u8_unchecked(id) })
            } else {
                None
            }
        }
